import { useEffect, useState } from "react";

const useFetch = (url, defaultValue) => {
    const [data,setData] = useState();
    useEffect(() => {
        fetch(url)
        .then(res => res.json())
        .then(result => [
            setData(Object.values(result))
        ]);

    },[url]);

    return(
        [data, setData]
    );
}

export default useFetch;
